import React, { useState } from 'react';
import { registerWithServer } from '../services/api';
import { TextField, Button, Typography } from '@mui/material';

const RegistrationPage = ({ onRegisterSuccess }) => {
  const [formData, setFormData] = useState({
    email: '',
    name: '',
    mobileNo: '',
    githubUsername: '',
    rollNo: '',
    collegeName: '',
    accessCode: '',
  });
  const [error, setError] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async () => {
    try {
      await registerWithServer(formData);
      onRegisterSuccess();
    } catch (err) {
      setError('Registration failed. Please check your details and try again.');
      console.error('Registration error:', err);
    }
  };

  return (
    <div style={{ padding: '20px', maxWidth: '400px', margin: '0 auto' }}>
      <Typography variant="h5" gutterBottom>
        Register with Test Server
      </Typography>
      <TextField
        label="Email"
        name="email"
        value={formData.email}
        onChange={handleChange}
        fullWidth
        margin="normal"
        type="email"
      />
      <TextField
        label="Name"
        name="name"
        value={formData.name}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      <TextField
        label="Mobile Number"
        name="mobileNo"
        value={formData.mobileNo}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      <TextField
        label="GitHub Username"
        name="githubUsername"
        value={formData.githubUsername}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      <TextField
        label="Roll Number"
        name="rollNo"
        value={formData.rollNo}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      <TextField
        label="College Name"
        name="collegeName"
        value={formData.collegeName}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      <TextField
        label="Access Code"
        name="accessCode"
        value={formData.accessCode}
        onChange={handleChange}
        fullWidth
        margin="normal"
      />
      {error && (
        <Typography color="error" style={{ margin: '10px 0' }}>
          {error}
        </Typography>
      )}
      <Button variant="contained" onClick={handleSubmit} style={{ marginTop: '10px' }}>
        Register
      </Button>
    </div>
  );
};

export default RegistrationPage;
